import * as React from 'react';

export default function SignUpMFA() {

  // Make a GET request
  const postUrl = 'https://google-authenticator.p.rapidapi.com/new_v2/';

  fetch(postUrl, {
    method: "GET",
    headers: {
      'X-RapidAPI-Key': '414bc5d180msh86e5db53aea8bbcp1bcd81jsn6915fb5401f0'
    }
  }).then((response) => response.json())
  .then((data) => {
    console.log(data);
  }).catch((error) => console.log(error));


  return (
    <h1>Scan the barcode from Google Authenticator</h1>


  )
}
